All countries are tracking the origin of the new coronavirus. Many scientists are studying the DNA sequence of the virus. Is the us the origin of the new coronavirus? Here are some time points of events and coincidences. Please refer to them and make your own judgment:


On May 2, 2019, the Virginia biochemical defense base of the United States established the research of antiviral agents, namely SARS / mers. At the same time, the biological laboratory of Fort Detrick, Maryland began to recruit animal managers. The laboratory conducted biological experiments on animals;

In June, the CDC of the United States changed the injection system of pneumonia vaccine which has been followed for many years, and began to inject vaccine to people through investigation and screening;

In the first ten days of July, there were more than 60 cases of pneumonia of unknown cause and one case died near the two bases. The patients were mainly the elderly, including the nursing homes near the bases, and even the personnel of the D.C biochemical Defense Center of the US Army were infected;

On July 15, the U.S. military suspended the biological research project; on July 19, two military biological experimental bases in Virginia and Fort Detrick were completely closed.

On August 5, the media began to follow up unidentified pneumonia and targeted questions about the CDC in the United States, without a positive answer;

The novel coronavirus pneumonia was classified as an electronic cigarette in August 19th by CDC in the US. After that, the investigation on the disease of electronic smoke was fruitless. At that time, chest CT images were also frosted glassy, which was very similar to the new coronavirus pneumonia.

On August 21, the "201 incident" in the United States was a simulated epidemic prevention exercise against a large-scale coronavirus outbreak in the United States, including the United States CIA;

On October 18, 2019, at the Wuhan military games, the American soy sauce soldiers got the worst result in history. At the end of October, the military games ended, and the American high-cost special plane picked up five soy sauce soldiers with special patients two days in advance.More than 300 others flew home in two days.

